from Utils.Writer import Writer
from Logic.ClientHome import *
from Logic.ClientAvatar import *


class OwnHomeDataMessage(Writer):

    def __init__(self, client, player):
        super().__init__(client)
        self.player = player
        self.id = 24101

    def encode(self):
        self.writeHexa("")

        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(5)

        self.writeString("Solar") # Name

        self.writeVInt(0)
        self.writeVInt(1)

        self.writeHexa("")
        
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(6)
        self.writeVInt(1)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)
        self.writeVInt(0)

        self.writeHexa("A4010000000A7F00010000")


        print("[*] OwnHomeDataMessage sent")